import React from 'react'
import _ from 'lodash'
const PostRender = (props) => {
  const { results } = props.post
  console.log(results)
  const indi = () => {
    return _.map(results, post => {
      return (
        <div>
          <li key={post.pk}>
            {post.name}
          </li>
        </div>
      )
    })
  }
  console.log(indi())
  return (
    <ul>{indi()}</ul>
  )
}

export default PostRender
